svg.script:
/**
 * ISS Tracker for SVG Map
 * -------------------------------------------------------
 * - Fetches live ISS latitude/longitude from API
 * - Converts lat/lon to x/y for a 1000x500 equirectangular map
 * - Moves the SVG element with ID "ISS"
 * - Updates once per second
 * - Includes logging and error handling for beginners
 */

// API endpoint for ISS position
const ISS_API_URL = "https://api.wheretheiss.at/v1/satellites/25544";

// Size of the SVG map (from your viewBox)
const MAP_WIDTH = 1000;
const MAP_HEIGHT = 500;

/**
 * Convert latitude/longitude into SVG x/y coordinates
 * WHY this works:
 * - Longitude: -180 → +180 maps left → right
 * - Latitude: +90 → -90 maps top → bottom
 */
function latLonToXY(latitude, longitude) {
  const x = ((longitude + 180) / 360) * MAP_WIDTH;
  const y = ((90 - latitude) / 180) * MAP_HEIGHT;
  return { x, y };
}

/**
 * Fetch ISS data and update its position on the map
 */
async function updateISSPosition() {
  try {
    // Get the ISS element from the SVG
    const issElement = document.getElementById("ISS");

    // Safety check: if the element doesn't exist, stop gracefully
    if (!issElement) {
      console.error("ISS element not found in SVG", new Date().toLocaleTimeString());
      return;
    }

    // Fetch live ISS position
    const response = await fetch(ISS_API_URL);
    const data = await response.json();

    // Pull latitude & longitude from API response
    const latitude = data.latitude;
    const longitude = data.longitude;

    // Convert lat/lon to SVG coordinates
    const position = latLonToXY(latitude, longitude);

    // Move the ISS using a translate transform
    // NOTE: This assumes your ISS artwork is centered at (0,0)
    issElement.setAttribute(
      "transform",
      `translate(${position.x}, ${position.y})`
    );

    // Helpful debug logging with timestamp
    console.log(
      "ISS updated:",
      "lat:", latitude.toFixed(2),
      "lon:", longitude.toFixed(2),
      "→ x:", position.x.toFixed(1),
      "y:", position.y.toFixed(1),
      new Date().toLocaleTimeString()
    );

  } catch (error) {
    // Catch network or parsing errors
    console.error("ISS update failed:", error, new Date().toLocaleTimeString());
  }
}

// Run once immediately so you don't wait 1 second
updateISSPosition();

// Update every 1000ms (1 second)
setInterval(updateISSPosition, 1000);
